import React, { Component } from 'react'
import Cars from './cars'

class Rental extends Component{
    state = {
        cars:[
            {name:"Mercedes AMG G63", src:"/images/AMG-g63.jpg",id:1},
            {name:"Lamborghini Aventador",src:"/images/aventador.jpg",id:2},
            {name:"Porsche Cayman", src:"images/cayman.jpg",id:3},
            {name:"LamborghiniiUrus", src:"images/urus.jpg",id:4},
        ]
    }
    render(){
        return(
            <div className="container">
                <Cars />
            </div>
        )
    }

}

export default Rental;
